import { StyledFooter } from "../styles/Footer.styled";

export const Footer = () => {
  return (
    <>
      <StyledFooter>
        <p>Coded with React and Styled Components</p>
        <div> &copy; February 2022</div>
      </StyledFooter>
    </>
  );
};
